import { useEffect } from "react";
import {
  Route,
  Routes,
  useLocation,
  useNavigationType,
} from "react-router-dom";
import MainWinodw from "./components/MainWindow";
import Desktop from "./pages/Desktop";
import Desktop1 from "./pages/Desktop1";
import Frame from "./pages/Frame";
import Frame2 from "./pages/Frame2";
import Frame3 from "./pages/Frame3";
import Frame4 from "./pages/Frame4";
import Frame5 from "./pages/Frame5";
import ProjectsPage from "./pages/ProjectsPage";
import ProjectsPage1 from "./pages/ProjectsPage1";
import ProjectsPage2 from "./pages/ProjectsPage2";
import ProjectsPage3 from "./pages/ProjectsPage3";

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action, pathname]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;
      case "/frame-371":
        title = "";
        metaDescription = "";
        break;
      case "/projects-page-1":
        title = "";
        metaDescription = "";
        break;
      case "/frame-372":
        title = "";
        metaDescription = "";
        break;
      case "/projects-page-2":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-2":
        title = "";
        metaDescription = "";
        break;
      case "/frame-373":
        title = "";
        metaDescription = "";
        break;
      case "/projects-page":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-1":
        title = "";
        metaDescription = "";
        break;
      case "/frame-374":
        title = "";
        metaDescription = "";
        break;
      case "/projects-page-3":
        title = "";
        metaDescription = "";
        break;
      case "/frame-375":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag = document.querySelector(
        'head > meta[name="description"]',
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<MainWinodw />} />
      <Route path="/frame-371" element={<Frame4 />} />
      <Route path="/projects-page-1" element={<ProjectsPage3 />} />
      <Route path="/frame-372" element={<Frame5 />} />
      <Route path="/projects-page-2" element={<ProjectsPage1 />} />
      <Route path="/desktop-2" element={<Desktop />} />
      <Route path="/frame-373" element={<Frame />} />
      <Route path="/projects-page" element={<ProjectsPage />} />
      <Route path="/desktop-1" element={<Desktop1 />} />
      <Route path="/frame-374" element={<Frame2 />} />
      <Route path="/projects-page-3" element={<ProjectsPage2 />} />
      <Route path="/frame-375" element={<Frame3 />} />
    </Routes>
  );
}
export default App;
